// index.js
const app=getApp()
let audio = wx.createInnerAudioContext()
Page({
  data:{
    click:0,
    imgSrc: '../../images/kitty.png'
  },
  playPussy: function() {
    if(this.data.click % 3 === 0){
      audio.src= 'https://static.r-ay.cn/dingzhen.mp3'
      this.setData({
        imgSrc: 'https://gimg2.baidu.com/image_search/src=http%3A%2F%2Fc-ssl.duitang.com%2Fuploads%2Fblog%2F202102%2F26%2F20210226195625_096a6.thumb.1000_0.jpeg&refer=http%3A%2F%2Fc-ssl.duitang.com&app=2002&size=f9999,10000&q=a80&n=0&g=0n&fmt=auto?sec=1672387978&t=54eb923b6927cceff2d29af63e49e9d0'
      })
      audio.seek(59)
      audio.play()
    }else if(this.data.click % 3 === 1){
      audio.src= 'https://static.r-ay.cn/caixukun.mp3'
      this.setData({
        imgSrc: 'data:image/jpeg;base64,'
      })
      audio.seek(3)
      audio.play()
    }else {
      this.setData({
        imgSrc: '../../images/kitty.png'
      })
      audio.pause()
    }
    this.setData({
      click: ++ this.data.click
    })
  }
})
